import React, { useState } from 'react';
import Context from './MyContext';

function Provider({ children }) {
  const [infoApiUsuario, setInfoApiUsuario] = useState('');

  const contextValue = {
    infoApiUsuario,
    setInfoApiUsuario,
  };

  return (
    <Context.Provider value={contextValue}>
      { children }
    </Context.Provider>
  );
}

export default Provider;
